;eval("define(\"lsu-scheduler/templates/stack\", \n  [\"ember\",\"exports\"],\n  function(__dependency1__, __exports__) {\n    \"use strict\";\n    var Ember = __dependency1__[\"default\"];\n    __exports__[\"default\"] = Ember.Handlebars.template(function anonymous(Handlebars,depth0,helpers,partials,data) {\n    this.compilerInfo = [4,\'>= 1.0.0\'];\n    helpers = this.merge(helpers, Ember.Handlebars.helpers); data = data || {};\n      \n\n\n      data.buffer.push(\"<div class=\\\"container\\\">\\n  <!-- START THE FEATURETTES -->\\n  <div class=\\\"page-header\\\">\\n    <h1>The Stack</h1>\\n  </div>\\n\\n  <h2 class=\\\"text-center\\\">Backend</h2>\\n\\n  <hr class=\\\"featurette-divider\\\">\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">We are hosted freely by Heroku</h3>\\n          <p class=\\\"lead\\\">Heroku (pronounced her-OH-koo) is a cloud application platform – a new way\\n            of building and deploying web apps.</p>\\n          <p>One of the first cloud platforms, Heroku has been\\n            in development since June 2007, when it supported only the Ruby programming language,\\n            but has since added support for Java, Node.js, Scala, Clojure, Python and PHP and\\n            (undocumented) Perl. The base operating system is Debian or, in the newest stack,\\n            the Debian-based Ubuntu.</p>\\n        </div>\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/cmh1Bhc.png\\\" alt=\\\"ember.js logo\\\">\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/nykLble.png\\\" alt=\\\"node.js logo\\\">\\n        </div>\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">Our code is 100% Javascript, thanks to Node.js</h3>\\n          <p class=\\\"lead\\\">Node.js is an open source, cross-platform runtime environment for server-side\\n            and networking applications.</p>\\n          <p>Node.js applications are written in JavaScript,\\n            and can be run within the Node.js runtime on OS X, Microsoft Windows, Linux\\n            and FreeBSD.</p>\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">Express serves our site quickly on any computer</h3>\\n          <p class=\\\"lead\\\">Express is a minimal and flexible Node.js web application\\n            framework that provides a robust set of features for web and mobile applications.\\n          </p>\\n          <p>One command can turn any computer into a clone of LSU Secheduler with comparable performance\\n            to traditional webservers, without the need for complicated server software like nginx or apache.\\n            Though, if you do know how to use nginx (or apache), it would be easy to\\n            scale up using reverse port forwarding and upstream connection pooling by\\n            running multiple (identical) express servers on the same computer or local network.</p>\\n        </div>\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/V8LVOZ3.png\\\" alt=\\\"ember.js logo\\\">\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/owIPllW.png\\\" alt=\\\"Generic placeholder image\\\">\\n        </div>\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">Sequelize abstracts our database queries so everyone wins</h3>\\n          <p class=\\\"lead\\\">The Sequelize library provides easy access to MySQL, MariaDB, SQLite or PostgreSQL\\n          databases by mapping database entries to objects and vice versa.</p>\\n          <p>To put it in a nutshell,\\n          it\'s an ORM (Object-Relational-Mapper). The library is written entirely in JavaScript\\n          and can be used in the Node.JS environment.</p>\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">PostgreSQL manages our data in production, though</h3>\\n          <p class=\\\"lead\\\">PostgreSQL is an object-relational database management system (ORDBMS) with an emphasis\\n              on extensibility and standards-compliance.</p>\\n          <p>It can handle workloads ranging from small single-machine applications\\n            to large Internet-facing applications with many concurrent users. Recent versions\\n            also provide replication of the database itself for security and scalability.</p>\\n        </div>\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/ylOy5UK.png\\\" alt=\\\"ember.js logo\\\">\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <h2 class=\\\"text-center\\\">Frontend</h2>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">Ember makes interactive frontend development fast and easy</h3>\\n          <p class=\\\"lead\\\">Ember.js is an open-source\\n            client-side JavaScript web application framework based on the model-view-controller\\n            (MVC) software architectural pattern.</p>\\n          <p>It allows developers to create\\n            scalable single-page applications by incorporating common idioms and\\n            best practices into a framework that provides a rich object model,\\n            declarative two-way data binding, computed properties,\\n            automatically-updating templates powered by Handlebars.js, and a router\\n            for managing application state.</p>\\n        </div>\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/QgERiyu.png\\\" alt=\\\"ember.js logo\\\">\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/2P5kdPx.png\\\" alt=\\\"Generic placeholder image\\\">\\n        </div>\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">And like everyone else, we use Bootstrap</h3>\\n          <p class=\\\"lead\\\">Bootstrap is a free collection\\n            of tools for creating websites and web applications.</p>\\n          <p>It contains HTML and\\n          CSS-based design templates for typography, forms, buttons, navigation and\\n          other interface components, as well as optional JavaScript extensions. In\\n          June 2014 it was the No.1 project on GitHub with over 73,000 stars and more\\n          than 27,000 forks, and a user base that includes MSNBC and NASA.</p>\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">With some eye candy by Font Awesome</h3>\\n          <p class=\\\"lead\\\">Font Awesome gives you scalable vector icons that can\\n            instantly be customized — size, color, drop shadow, and anything that\\n            can be done with the power of CSS.</p>\\n        </div>\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/K2dYbyu.png\\\" alt=\\\"ember.js logo\\\">\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/w3YmUPD.png\\\" alt=\\\"Generic placeholder image\\\">\\n        </div>\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">Full Calendar is why the schedules look so pretty</h3>\\n          <p class=\\\"lead\\\">FullCalendar is a jQuery plugin that provides a full-sized,\\n            drag and drop event. It uses AJAX to fetch events\\n            on-the-fly and is easily configured to use your own feed format. It is\\n            visually customizable with a rich API.</p>\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">And last but not least, thank Imgur for hosting these pics</h3>\\n          <p class=\\\"lead\\\">Imgur is an image community that creates, consumes and\\n            shares tomorrow\'s viral images, today.</p>\\n          <p>Millions of images are uploaded\\n            each day to Imgur, where they are distilled by the Imgurian community\\n            into a stream of the Internet\'s best images and viewed billions of times.\\n            Expect to laugh, cry and be inspired by the images you\'ll find here.</p>\\n        </div>\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/ICEE6DF.png\\\" alt=\\\"ember.js logo\\\">\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <h2 class=\\\"text-center\\\">Development</h2>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/ZCCZehI.png\\\" alt=\\\"Generic placeholder image\\\">\\n        </div>\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">GitHub makes code collaboration simple</h3>\\n          <p class=\\\"lead\\\">GitHub is a Git repository web-based hosting service,\\n            which offers all of the distributed revision control and source code\\n            management (SCM) functionality of Git as well as adding its own features.</p>\\n          <p>Unlike Git, which is strictly a command-line tool, GitHub provides a\\n            web-based graphical interface and desktop as well as mobile integration.\\n            It also provides access control and several collaboration features such\\n            as wikis, task management, and bug tracking and feature requests for\\n            every project.</p>\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">ember-cli is a commandline toolkit with super powers</h3>\\n          <p class=\\\"lead\\\">Ember CLI is an Ember.js command line utility which provides a fast asset\\n            pipeline powered by broccoli and strong conventional project structure.\\n          </p>\\n          <p>Broccoli has support for:</p>\\n          <ul>\\n            <li>Handlebars</li>\\n            <li>Emblem</li>\\n            <li>LESS</li>\\n            <li>SASS</li>\\n            <li>Compass</li>\\n            <li>Stylus</li>\\n            <li>CoffeeScript</li>\\n            <li>EmberScript</li>\\n            <li>Minified JS and CSS</li>\\n          </ul>\\n        </div>\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/1dBSynJ.png\\\" alt=\\\"Generic placeholder image\\\">\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <div class=\\\"row featurette\\\">\\n        <div class=\\\"col-md-5\\\">\\n          <img class=\\\"featurette-image img-responsive\\\" src=\\\"//i.imgur.com/A0MBWIx.png\\\" alt=\\\"Generic placeholder image\\\">\\n        </div>\\n        <div class=\\\"col-md-7\\\">\\n          <h3 class=\\\"featurette-heading\\\">Bower keeps our front end libraries in order and up to date</h3>\\n          <p class=\\\"lead\\\">Web sites are made of lots of things-- 2014 frameworks,\\n            libraries, assets, utilities, and rainbows. Bower manages all these\\n            things for you.</p>\\n          <p>Bower works by fetching and installing packages from all over, taking\\n            care of hunting, finding, downloading, and saving the stuff you\'re\\n            looking for. Bower keeps track of these packages in a manifest file,\\n            `bower.json`. How you use packages is up to you. Bower provides hooks\\n            to facilitate using packages in your tools and workflows.</p>\\n          <p>Bower is optimized for the front-end. Bower uses a flat dependency\\n            tree, requiring only one version for each package, reducing page load\\n            to a minimum.</p>\\n        </div>\\n      </div>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <h2 class=\\\"text-center\\\"><a href=\\\"https://developers.google.com/speed/pagespeed/insights/?url=lsu-scheduler.herokuapp.com&tab=desktop\\\">How are we doing?</a></h2>\\n\\n      <hr class=\\\"featurette-divider\\\">\\n\\n      <!-- Jumbotron -->\\n      <div class=\\\"jumbotron\\\">\\n        <h2>Does any of this stuff sound cool to you?</h2>\\n        <p class=\\\"lead\\\">Want to build one for your university, have a feature you want to add, or just think something could be done better?</p>\\n        <p class=\\\"lead\\\">LSU Scheduler is 100% open source, and all software used is avaliable on\\n          every platform and is heavily documented. So make it happen!</p>\\n        <p class=\\\"lead\\\">Contributions are not only very welcome, but probably the only\\n          way this project will survive.</p>\\n        <p class=\\\"text-center\\\"><a type=\\\"button\\\" class=\\\"btn btn-primary\\\" href=\\\"https://github.com/selbyk/lsu-scheduler\\\">\\n          <i class=\\\"fa fa-code-fork\\\"> Fork on GitHub</i></a></p>\\n      </div>\\n</div>\\n\");\n      \n    });\n  });//# sourceURL=lsu-scheduler/templates/stack.js");

